import React from 'react'
import homeStore from '../stores/homeStore';

import { Header } from '../components/Header';
import Listitem from '../components/Listitem';

const Home = () => {

const store = homeStore()

React.useEffect(() => {
    store.fetchCoins()
}, [])

  return (
<div>
    <Header/>
    <header className='home-search'>
        <div className='width'>
            <h2>Search for a coin</h2>
            <div className="home-search-input">
                <input type='text' value={store.query} onChange={store.setQuery} />

<svg xmlns="http://www.w3.org/2000/svg" height="20" viewBox="0 -960 960 960" width="24"><path d="M480-80q-82 0-155-31.5t-127.5-86Q143-252 111.5-325T80-480q0-83 31.5-155.5t86-127Q252-817 325-848.5T480-880q17 0 28.5 11.5T520-840q0 17-11.5 28.5T480-800q-133 0-226.5 93.5T160-480q0 133 93.5 226.5T480-160q133 0 226.5-93.5T800-480q0-17 11.5-28.5T840-520q17 0 28.5 11.5T880-480q0 82-31.5 155t-86 127.5q-54.5 54.5-127 86T480-80Z"/></svg>
            </div>
        </div>

    </header>
        <div className='home-cryptos'>
            <div className="width">
                <h2>Trending Coins</h2>
                <div className="home-cryptos-list">
                    {store.coins.map(coin => {
                        return(
                            <Listitem key={coin.id} coin={coin} />
                        )
                    })}
                </div>
            </div>

    </div>
</div>
  )
}

export default Home;
